message.content:
Here is the schema for the `drawCircle` function, which can be enrolled into the application:

```json
{
  "schema": {
    "name": "drawCircle",
    "description": "Draw a circle with the given center and radius.",
    "parameters": {
      "type": "object",
      "properties": {
        "type": {
          "type": "string",
          "enum": ["circle"],
          "description": "The type of shape to draw."
        },
        "center": {
          "type": "object",
          "properties": {
            "x": {
              "type": "number",
              "description": "The x-coordinate of the center."
            },
            "y": {
              "type": "number",
              "description": "The y-coordinate of the center."
            }
          },
          "required": ["x", "y"],
          "description": "The center coordinates of the circle."
        },
        "radius": {
          "type": "number",
          "description": "The radius of the circle. Must be a positive number.",
          "minimum": 0
        }
      },
      "required": ["type", "center", "radius"],
      "additionalProperties": false
    },
    "output": {
      "type": "null",
      "description": "No return value."
    }
  }
}
```
